BUFSIZE = 2048

def tcpConnect(addr, port, blk):
	"""Returned a connected client socket (blocking on connect...)"""
	s = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
	s.setsockopt(socket.IPPROTO_TCP, socket.TCP_NODELAY, 1)
	s.connect((addr,port))
	s.setblocking(blk)
	return s

def hexdump(data):
	import subprocess
	ret = subprocess.Popen(['xxd','-'],stdin=subprocess.PIPE,stdout=subprocess.PIPE).communicate(data)[0]
	print(ret.decode('ascii'))

def full_proxy():
	s_fake = tcpConnect('3.93.128.89',12022,0)
	s_server = tcpConnect('3.93.128.89',12021,0)

	ret = s_fake.recv(1024)
	print(ret.decode('ascii'))

	channel = {}
	channel[s_fake] = s_server
	channel[s_server] = s_fake

	names = {}
	names[s_fake] = 'Client to Server (recv from fake, send to server)'
	names[s_server] = 'Server to Client (recv from server, send to fake)'

	conn_stable = True

	accum = defaultdict(lambda:b'')

	try:
		while conn_stable:
			#time.sleep(.1)
			inputready, outputready, exceptready = select.select(channel.keys(),[],[])

			for s in inputready:
				data = s.recv(BUFSIZE)
				if len(data) == 0:
					print('connection closed...')
					conn_stable = False
					break
				accum[s] = accum[s] + data

				print('Data (%s): -- 0x%x accum total'%(names[s],len(accum[s])))
				hexdump(data)
				channel[s].send(data)

	except:
		# catch the ctrl-c here
		pass

	accum1 = accum[s_fake]
	k = accum[s_server][:16]
	accum2 = accum[s_server][16:]

	n = min(len(accum1),len(accum2))

	hexdump(accum1[:n])
	hexdump(accum2[:n])

	print('accumulation')
	hexdump(bytes([accum1[i]^accum2[i] for i in range(n)]))

	print(binascii.hexlify(k))
	print(binascii.hexlify(accum2))
	print(binascii.hexlify(accum1))

	sys.exit(0)

def xor(arr1,arr2):
	return bytes([arr1[i]^arr2[i] for i in range(min(len(arr1),len(arr2)))])

