def pb_int(s):
	val = 0
	for i in range(len(s)):
		val = val + ((s[i]&0x7f)<<(7*i))
	if val > 0x8000000000000000:
		val -= 0x10000000000000000
	return val

def pb_parse(st,indent=''):
	# manual probuf parsing, later proved unnecessary
	while len(st) > 0:
		#print('trying..', st[:3])
		cnt = st[0]>>3
		typ = st[0]&0x7
		if typ == 0:
			n = 1
			while st[n]&0x80 != 0:
				n += 1
			m = pb_int(st[1:n+1])
			#print(indent+binascii.hexlify(st[0:n+1]).decode('ascii')+' #%d int 0x%x == %d'%(cnt,m,m))
			print(indent+'#%d int %d'%(cnt,m))
			st = st[n+1:]
		elif typ == 2:
			n = 1
			while st[n]&0x80 != 0:
				n += 1
			m = pb_int(st[1:n+1])
			#print(indent+binascii.hexlify(st[0:n+1]).decode('ascii')+' #%d string 0x%x == %d long'%(cnt,m,m))
			print(indent+'#%d string %d long'%(cnt,m))
			pb_parse(st[n+1:n+1+m],indent+'  ')
			st = st[n+1+m:]
		else:
			raise Exception('dont know type %d'%typ)

def solver(username, password):
	# runup the 

	s_fake = tcpConnect('3.93.128.89',12022,1)
	s_server = tcpConnect('3.93.128.89',12021,1)

	ret = s_fake.recv(1024)
	print(ret.decode('ascii'))

